import React from 'react';
import './Navbar.css'; 


function Navbar() {
  return (
    <header className="custom-header">
      <div className="logo">
        <img src="/bus-stop.png"/>
        <span className="logo-text">CheapTicket</span>
      </div>
      <nav className="nav-menu">
        <ul>
          <li><a href="#">Quản lý đơn hàng</a></li>
          <li><a href="#">Mở bán vé trên CheapTicket</a></li>
          <li><button className="login-button">Đăng nhập</button></li>
        </ul>
      </nav>
    </header>
  );
}

export default Navbar;
